import React from 'react';

function Nav(props) {
    const {
        aboutSelected,
        setAboutSelected,
        contactSelected,
        setContactSelected,
        portfolioSelected,
        setPortfolioSelected,
        resumeSelected,
        setResumeSelected
    } = props;

    return (
        <header>
            <h2>
                <a>
                    <span>Michelle GLEAVE</span>
                </a>
            </h2>
            <nav>
                <ul id="nav">
                    <li>
                        <a
                            onCLick={() => {
                                setAboutSelected(true);
                                setContactSelected(false);
                                setPortfolioSelected(false);
                                setResumeSelected(false);
                            }}

                            href="/">
                            About Me
                        </a>
                    </li>
                    <li>
                        <a
                            onCLick={() => {
                                setAboutSelected(false);
                                setContactSelected(true);
                                setPortfolioSelected(false);
                                setResumeSelected(false);
                            }}

                            href="/">
                            Contact
                        </a>
                    </li>
                    <li>
                        <a
                            onCLick={() => {
                                setAboutSelected(false);
                                setContactSelected(false);
                                setPortfolioSelected(true);
                                setResumeSelected(false);
                            }}
                            href="/">
                            Portfolio
                        </a>
                    </li>
                    <li>
                        <a
                            onCLick={() => {
                                setAboutSelected(true);
                                setContactSelected(false);
                                setPortfolioSelected(false);
                                setResumeSelected(false);
                            }}

                            href="/">
                            Resume
                        </a>
                    </li>
                </ul>
            </nav>
        </header>
    )
}

export default Nav;
